package loop5;

public class Text5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10;
		int n = 100;
		System.out.println("Even number between 10-100");
		while(i<=n)
		{
			
			if(i%2==0)
			{
				System.out.println(i);
			}
			i++;
		}
	}

}
